import { version, Tree, Input } from "antd"
import React from "react";
const { TreeNode, TreeSelect } = Tree

const Dragable = () => {
    return <> <Tree
    draggable={true}
    onDragStart={({ event }) => {
      if (event.target.tagName === "INPUT") {
        event.stopPropagation();
        event.preventDefault();
      }
    }}
  >
      <TreeSelect
      Dragable
      >
    <TreeNode
    key='1'
      title={
        <div>
          <Input draggable defaultValue="Can't select this" />
          But you can grab me from here !1
        </div>
      }
    />
        <TreeNode
        key='2'
      title={
        <div>
          <Input draggable defaultValue="Can't select this" />
          But you can grab me from here !2
        </div>
      }
    />
    </TreeSelect>
  </Tree>
  </>
}

export default Dragable
